    for i in range(len(former)):
        m.addConstr(Ins[former[i]], GRB.LESS_EQUAL, Ins[latter[i]])

    # offset
    for i in range(DI):
        m.addConstr(Off[i] == quicksum(Pdn[cor(i), n] * Q[n] for n in range(N)))

